import React, { useState } from "react";

export default function Button() {
  const [cls, setCls] = useState("default");

  return (
    <>
      <style>{`
        .default:hover {
        	background-color: #ffcc00;
        }

      `}</style>
      <button
        className={cls}
        onClick={() => setCls((cls) => (cls === "red" ? "green" : "red"))}
      >
        Get Started
      </button>
    </>
  );
}
